import { React } from "react";
import { createRoot } from "react-dom/client";
import Homepage from "./PageComponents/Homepage";
import Footer from "./PageComponents/Footer";

import styled from "styled-components";
import {
  BrowserRouter as Router,
  Route,
  Link,
  Routes,
  Navigate,
} from "react-router-dom";

const StyledLink = styled(Link)`
  text-decoration: none;
`;

const response = fetch("http://localhost:3002/api/v1/settings");

// Async function to fetch data from settings
async function fetchSettings() {
  await fetch("http://localhost:3002/api/v1/settings")
    .then((response) => response.json())
    .then((data) => {
      return data;
    });
  //return data;
}
const data = fetchSettings();
console.log("---");

if (data) {
  console.log(data.result);
}

const container = document.getElementById("root");
const root = createRoot(container);

root.render(
  <Router>
    <nav
      className="navbar navbar-expand-lg navbar-dark"
      style={{
        background: "linear-gradient(120deg,#7f70f5,#0ea0ff)",
        color: "#fff",
        padding: 20 + "px",
      }}
    >
      <div className="container-fluid">
        <a className="navbar-brand" href="/">
          Maysen Greenwood
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNavDropdown"
          aria-controls="navbarNavDropdown"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <a className="nav-link active" id="/" href="/">
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" id="/my-projects" href="/my-projects">
                Projects
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" id="/cv" href="/cv">
                CV
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>

    <Routes>
      <Route exact path="/" element={<Homepage />} />

      <Route path="*" element={<Navigate from="*" to="/" />} />
    </Routes>

    <Footer />
  </Router>
);
